import React, {Component} from 'react'

interface Props{

}

interface State{
    disable : boolean[]
}

class Menu extends Component<Props,State>{
    constructor(props:Props){
        super(props);
        this.state = {
            disable : [true,false,false]
        }
    }

    private main(){
        return(
            <div>
                <div>Главная</div>
                <div>Мои курсовые</div>
                <div>Свободные курсовые</div>
            </div>
        )
    }

    render = () => this.main
}

export default Menu
